import Statistics from '../Statistics/Statistics'

const StatisticList = ({ items }) => (
  <ul>
    {items.map((item) => (
      <li key={item.id} class="item">
        <Statistics item={item.label} percentage={item.percentage} />
      </li>
    ))}
  </ul>
)

export default StatisticList
